import React from "react";

const Footer = () => {
  return (
    <div className="bg-neutral-200 text-center border-t-2 border-b-2 border-black ">
      <div className="p-4 text-center text-neutral-500">
        {"© 2023 "}
        <a className="text-black">Oleksii Odazhiu</a>
      </div>
    </div>
  );
};

export default Footer;
